BEGIN TRANSACTION;
CREATE TABLE "logs" ("id" serial PRIMARY KEY NOT NULL, "msg" varchar NOT NULL, "level" varchar NOT NULL, "app" varchar, "tag" varchar, "pid" bigint, "tid" bigint, "ts" varchar, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "props" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "value" varchar NOT NULL, "kind" varchar, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "tags" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "slug" varchar NOT NULL, "name" varchar, "grade" bigint DEFAULT 1 NOT NULL, "parent_id" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "taggings" ("id" serial PRIMARY KEY NOT NULL, "tag_id" bigint NOT NULL, "taggable_id" bigint NOT NULL, "taggable_type" varchar NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "places" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "kind" varchar NOT NULL, "lat" float, "lng" float, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "names" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "place_id" bigint NOT NULL, "place_kind" varchar NOT NULL, "lang" varchar DEFAULT 'en' NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "continents" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "slug" varchar NOT NULL, "key" varchar NOT NULL, "place_id" bigint NOT NULL, "alt_names" varchar, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "country_codes" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "kind" varchar NOT NULL, "country_id" bigint NOT NULL);
CREATE TABLE "countries" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "slug" varchar NOT NULL, "key" varchar NOT NULL, "place_id" bigint NOT NULL, "code" varchar NOT NULL, "alt_names" varchar, "hist_names" varchar, "pop" bigint NOT NULL, "area" bigint NOT NULL, "continent_id" bigint, "country_id" bigint, "s" boolean DEFAULT 'f' NOT NULL, "c" boolean DEFAULT 'f' NOT NULL, "d" boolean DEFAULT 'f' NOT NULL, "m" boolean DEFAULT 'f' NOT NULL, "motor" varchar, "alpha2" varchar, "alpha3" varchar, "num" varchar, "fifa" varchar, "ioc" varchar, "fips" varchar, "net" varchar, "wikipedia" varchar, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "states" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" bigint NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "country_id" bigint NOT NULL, "level" bigint DEFAULT 1 NOT NULL, "pop" bigint, "area" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "parts" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" bigint NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "state_id" bigint NOT NULL, "level" bigint DEFAULT 2 NOT NULL, "pop" bigint, "area" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "counties" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" bigint NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "state_id" bigint NOT NULL, "part_id" bigint, "level" bigint DEFAULT 2 NOT NULL, "pop" bigint, "area" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "munis" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" bigint NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "state_id" bigint NOT NULL, "county_id" bigint, "level" bigint DEFAULT 3 NOT NULL, "pop" bigint, "area" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "zones" ("id" serial PRIMARY KEY NOT NULL);
CREATE TABLE "cities" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" bigint NOT NULL, "code" varchar, "alt_names" varchar, "country_id" bigint NOT NULL, "state_id" bigint, "part_id" bigint, "county_id" bigint, "muni_id" bigint, "metro_id" bigint, "pop" bigint, "area" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "metros" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" bigint NOT NULL, "code" varchar, "alt_names" varchar, "country_id" bigint NOT NULL, "pop" bigint, "area" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "districts" ("id" serial PRIMARY KEY NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" bigint NOT NULL, "code" varchar, "alt_names" varchar, "city_id" bigint NOT NULL, "pop" bigint, "area" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "langs" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "name" varchar NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "usages" ("id" serial PRIMARY KEY NOT NULL, "country_id" bigint NOT NULL, "lang_id" bigint NOT NULL, "official" boolean DEFAULT 't' NOT NULL, "minor" boolean DEFAULT 'f' NOT NULL, "percent" float, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "persons" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "name" varchar NOT NULL, "synonyms" varchar, "code" varchar, "born_at" date, "city_id" bigint, "state_id" bigint, "country_id" bigint, "nationality_id" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "teams" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "title2" varchar, "code" varchar, "synonyms" varchar, "country_id" bigint NOT NULL, "city_id" bigint, "club" boolean DEFAULT 'f' NOT NULL, "since" bigint, "address" varchar, "web" varchar, "assoc_id" bigint, "national" boolean DEFAULT 'f' NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "grounds" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "synonyms" varchar, "country_id" bigint NOT NULL, "city_id" bigint, "since" bigint, "capacity" bigint, "address" varchar, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "goals" ("id" serial PRIMARY KEY NOT NULL, "person_id" bigint NOT NULL, "game_id" bigint NOT NULL, "team_id" bigint NOT NULL, "minute" bigint, "offset" bigint DEFAULT 0 NOT NULL, "score1" bigint, "score2" bigint, "penalty" boolean DEFAULT 'f' NOT NULL, "owngoal" boolean DEFAULT 'f' NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "rosters" ("id" serial PRIMARY KEY NOT NULL, "person_id" bigint NOT NULL, "team_id" bigint NOT NULL, "event_id" bigint, "pos" bigint NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "events" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "league_id" bigint NOT NULL, "season_id" bigint NOT NULL, "start_at" date NOT NULL, "end_at" date, "team3" boolean DEFAULT 't' NOT NULL, "sources" varchar, "config" varchar, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "rounds" ("id" serial PRIMARY KEY NOT NULL, "event_id" bigint NOT NULL, "title" varchar NOT NULL, "title2" varchar, "pos" bigint NOT NULL, "knockout" boolean DEFAULT 'f' NOT NULL, "start_at" date NOT NULL, "end_at" date, "auto" boolean DEFAULT 't' NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "groups" ("id" serial PRIMARY KEY NOT NULL, "event_id" bigint NOT NULL, "title" varchar NOT NULL, "pos" bigint NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "games" ("id" serial PRIMARY KEY NOT NULL, "key" varchar, "round_id" bigint NOT NULL, "pos" bigint NOT NULL, "group_id" bigint, "team1_id" bigint NOT NULL, "team2_id" bigint NOT NULL, "play_at" timestamp with time zone NOT NULL, "postponed" boolean DEFAULT 'f' NOT NULL, "play_at_v2" timestamp with time zone, "play_at_v3" timestamp with time zone, "ground_id" bigint, "city_id" bigint, "knockout" boolean DEFAULT 'f' NOT NULL, "home" boolean DEFAULT 't' NOT NULL, "score1" bigint, "score2" bigint, "score1et" bigint, "score2et" bigint, "score1p" bigint, "score2p" bigint, "score1i" bigint, "score2i" bigint, "score1ii" bigint, "score2ii" bigint, "next_game_id" bigint, "prev_game_id" bigint, "winner" bigint, "winner90" bigint, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "events_teams" ("id" serial PRIMARY KEY NOT NULL, "event_id" bigint NOT NULL, "team_id" bigint NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "events_grounds" ("id" serial PRIMARY KEY NOT NULL, "event_id" bigint NOT NULL, "ground_id" bigint NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "groups_teams" ("id" serial PRIMARY KEY NOT NULL, "group_id" bigint NOT NULL, "team_id" bigint NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "seasons" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "leagues" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "country_id" bigint, "club" boolean DEFAULT 'f' NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "badges" ("id" serial PRIMARY KEY NOT NULL, "team_id" bigint NOT NULL, "league_id" bigint NOT NULL, "season_id" bigint NOT NULL, "title" varchar NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "assocs" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "since" bigint, "web" varchar, "country_id" bigint, "national" boolean DEFAULT 'f' NOT NULL, "continental" boolean DEFAULT 'f' NOT NULL, "intercontinental" boolean DEFAULT 'f' NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "assocs_assocs" ("id" serial PRIMARY KEY NOT NULL, "assoc1_id" bigint NOT NULL, "assoc2_id" bigint NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "group_standings" ("id" serial PRIMARY KEY NOT NULL, "group_id" bigint NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "group_standing_entries" ("id" serial PRIMARY KEY NOT NULL, "group_standing_id" bigint NOT NULL, "team_id" bigint NOT NULL, "pos" bigint, "played" bigint, "won" bigint, "lost" bigint, "drawn" bigint, "goals_for" bigint, "goals_against" bigint, "pts" bigint, "comments" varchar, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "event_standings" ("id" serial PRIMARY KEY NOT NULL, "event_id" bigint NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "event_standing_entries" ("id" serial PRIMARY KEY NOT NULL, "event_standing_id" bigint NOT NULL, "team_id" bigint NOT NULL, "pos" bigint, "played" bigint, "won" bigint, "lost" bigint, "drawn" bigint, "goals_for" bigint, "goals_against" bigint, "pts" bigint, "comments" varchar, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "alltime_standings" ("id" serial PRIMARY KEY NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE TABLE "alltime_standing_entries" ("id" serial PRIMARY KEY NOT NULL, "alltime_standing_id" bigint NOT NULL, "team_id" bigint NOT NULL, "pos" bigint, "played" bigint, "won" bigint, "lost" bigint, "drawn" bigint, "goals_for" bigint, "goals_against" bigint, "pts" bigint, "recs" bigint, "comments" varchar, "created_at" timestamp with time zone, "updated_at" timestamp with time zone);
CREATE UNIQUE INDEX "index_tags_on_key" ON "tags" ("key");
CREATE INDEX "index_taggings_on_tag_id" ON "taggings" ("tag_id");
CREATE INDEX "index_taggings_on_taggable_id_and_taggable_type" ON "taggings" ("taggable_id", "taggable_type");
CREATE UNIQUE INDEX "index_taggings_on_taggable_id_and_taggable_type_and_tag_id" ON "taggings" ("taggable_id", "taggable_type", "tag_id");
CREATE UNIQUE INDEX "index_continents_on_key" ON "continents" ("key");
CREATE UNIQUE INDEX "index_country_codes_on_name_and_kind" ON "country_codes" ("name", "kind");
CREATE UNIQUE INDEX "index_countries_on_key" ON "countries" ("key");
CREATE UNIQUE INDEX "index_countries_on_code" ON "countries" ("code");
CREATE UNIQUE INDEX "index_states_on_key_and_country_id" ON "states" ("key", "country_id");
CREATE UNIQUE INDEX "index_teams_on_key" ON "teams" ("key");
CREATE UNIQUE INDEX "index_grounds_on_key" ON "grounds" ("key");
CREATE UNIQUE INDEX "index_events_on_key" ON "events" ("key");
CREATE INDEX "index_rounds_on_event_id" ON "rounds" ("event_id");
CREATE INDEX "index_groups_on_event_id" ON "groups" ("event_id");
CREATE UNIQUE INDEX "index_games_on_key" ON "games" ("key");
CREATE INDEX "index_games_on_round_id" ON "games" ("round_id");
CREATE INDEX "index_games_on_group_id" ON "games" ("group_id");
CREATE INDEX "index_games_on_next_game_id" ON "games" ("next_game_id");
CREATE INDEX "index_games_on_prev_game_id" ON "games" ("prev_game_id");
CREATE INDEX "index_games_on_team1_id" ON "games" ("team1_id");
CREATE INDEX "index_games_on_team2_id" ON "games" ("team2_id");
CREATE UNIQUE INDEX "index_events_teams_on_event_id_and_team_id" ON "events_teams" ("event_id", "team_id");
CREATE INDEX "index_events_teams_on_event_id" ON "events_teams" ("event_id");
CREATE UNIQUE INDEX "index_events_grounds_on_event_id_and_ground_id" ON "events_grounds" ("event_id", "ground_id");
CREATE INDEX "index_events_grounds_on_event_id" ON "events_grounds" ("event_id");
CREATE UNIQUE INDEX "index_groups_teams_on_group_id_and_team_id" ON "groups_teams" ("group_id", "team_id");
CREATE INDEX "index_groups_teams_on_group_id" ON "groups_teams" ("group_id");
CREATE UNIQUE INDEX "index_assocs_on_key" ON "assocs" ("key");
CREATE UNIQUE INDEX "index_assocs_assocs_on_assoc1_id_and_assoc2_id" ON "assocs_assocs" ("assoc1_id", "assoc2_id");
CREATE INDEX "index_assocs_assocs_on_assoc1_id" ON "assocs_assocs" ("assoc1_id");
CREATE INDEX "index_assocs_assocs_on_assoc2_id" ON "assocs_assocs" ("assoc2_id");
COMMIT;
